mutation CompleteItem($id: ID!) {
  checkItem(item: $id) {
    item {
      id
      completed
      ...Filtered_Items_remove
    }
  }
}

fragment Filtered_Items_remove on TodoItem {
  id
}

71fa4426fa8ba60f86d6fb0a2908c63c:
mutation UncompleteItem($id: ID!) {
  uncheckItem(item: $id) {
    item {
      id
      completed
      ...Filtered_Items_remove
    }
  }
}

fragment Filtered_Items_remove on TodoItem {
  id
}

2c0c4ce8b2a4ae98552ce72e6d677385:
subscription ItemUpdate($id: ID!) {
  itemUpdate(id: $id) {
    item {
      id
      completed
      text
      createdAt
    }
  }
}

10967d2188b18eb59fbf584e464ea304:
query AllItems($completed: Boolean) {
  filteredItems: items(completed: $completed) {
    id
    completed
    ...ItemEntry_item
  }
  allItems: items {
    id
    completed
  }
}

fragment ItemEntry_item on TodoItem {
  id
  text
  completed
  createdAt
}

2e75b105da88343c6c346ab5f50e8ef7:
mutation AddItem($input: AddItemInput!) {
  addItem(input: $input) {
    error {
      message
    }
  }
}

aa3f58b88d49fadfd8224cfe06424002:
subscription NewItem {
  newItem {
    item {
      ...All_Items_insert
      ...Filtered_Items_insert
      id
    }
  }
}

fragment All_Items_insert on TodoItem {
  id
  completed
}

fragment Filtered_Items_insert on TodoItem {
  id
  completed
  ...ItemEntry_item
}

fragment ItemEntry_item on TodoItem {
  id
  text
  completed
  createdAt
}
